    UpgradeInterfaceData(String name, Item toUpgrade, Item upgradedItem, UpgradeInterfaceCategory category, Item... requiredItems) {
        this.name = name;
        this.toUpgrade = toUpgrade;
        this.upgradedItem = upgradedItem;
        this.category = category;
        this.requiredItems = requiredItems;
    }

    private String name;
    private Item toUpgrade, upgradedItem;
    private UpgradeInterfaceCategory category;
    private Item[] requiredItems;

    public String getName() {
        return this.name;
    }

    public Item getToUpgrade() {
        return this.toUpgrade;
    }

    public Item getUpgradedItem() {
        return this.upgradedItem;
    }

    public UpgradeInterfaceCategory getCategory() {
        return this.category;
    }

    public Item[] getRequiredItems() {
        return this.requiredItems;
    }

    public static UpgradeInterfaceData[] forCategory(UpgradeInterfaceCategory category) {
        List<UpgradeInterfaceData> upgrade = new ArrayList<UpgradeInterfaceData>();
        for(UpgradeInterfaceData data : UpgradeInterfaceData.values()) {
            if(data == null)
                continue;
            if(data.getCategory() != category)
                continue;
            upgrade.add(data);
        }
        return upgrade.toArray(new UpgradeInterfaceData[upgrade.size()]);
    }
